(36, 'upload/news/1631670403c1.jpg', NULL, 'ຂໍຂອບໃຈ ຮ້ານ ເມິງ + ນ້ອຍ ທີ່ຫັນເປັນທັນສະໄໝ ໃຊ້ລະບົບໂປຼແກຼມ ທີ່ສາມາດຄູ້ມຄອງ ແລະ ບໍລິຫານ ທຸລະກິດຜ່ານ ໂທລະສັບມືຖື ໄດ້ທຸກທີ່ທຸກເວລາ', 'Thanks to Meung + Noi, which has become a state-of-the-art software system that can manage and manage your mobile business anytime, anywhere.', NULL, NULL, '<div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=mi%2Fhinh%2Fanh%2Fc2.jpg&amp;v=1631670289\" style=\"width: 50%;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=mi%2Fhinh%2Fanh%2Fc3.jpg&amp;v=1631670289\" style=\"width: 50%;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=mi%2Fhinh%2Fanh%2Fc4.jpg&amp;v=1631670289\" style=\"width: 50%;\"><br></div>', '<div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=mi%2Fhinh%2Fanh%2Fc2.jpg&amp;v=1631670289\" style=\"width: 905px;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=mi%2Fhinh%2Fanh%2Fc3.jpg&amp;v=1631670289\" style=\"width: 905px;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=mi%2Fhinh%2Fanh%2Fc4.jpg&amp;v=1631670289\" style=\"width: 905px;\"><br></div>', 1, '2021-09-15 08:46:43', '2021-09-15 08:46:43');
