(1, 'ກ່ຽວກັບ', 'About', 'about', '<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 100px;\" data-filename=\"LogoSmall80.png\"><span style=\"font-size: 1rem;\"><b><br></b></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><b><br></b></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><b>ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ</b></span></div><div style=\"text-align: left;\"><div style=\"\"><br></div><div style=\"\"><b>I. ສະພາບລວມ.</b></div><div style=\"\"><br></div><div style=\"text-align: justify; \">ຊີໄອທີ ສ້າງຕັ້ງຂື້ນ ໃນວັນທີ 09/09/2009 ໃນໄລຍະນັ້ນ ໄດ້ອອກຊື່ເປັນວິສາຫະກິດສ່ວນບຸກຄົນ ໂດຍອອຊື່ ເປັນ ຊີໄອທີ ຄອມພິວເຕີ ສ່ວນບຸກຄົນ ແລະ ໄດ້ຂື້ນມາເປັນ ບໍລິສັດ ຈຳກັດຜູ້ດຽວ ຢ່າງເປັນທາງການ ໃນວັນທີ 01/01/2016 ເປັນຕົ້ນມາ ໂດຍປະກອບມີບັນດາ ພະແນກການດັ່ງນີ້:&nbsp;<span style=\"font-size: 1rem;\">ພະແນກບັນຊີ - ຝ່າຍຂາຍ, ພະແນກເຕັກນິກ - ຄັງສາງ, ພະແນກພັດທະນາ - ບໍລິການ, ພະແນກຫ້ອງການບໍລິຫານ ແລະ ຈັດຕັ້ງພະນັກງານ ໂດຍແຕ່ລະພະແນກການ ຈະມີພາລະບົດບາດ, ສິດ ແລະ ມີໜ້າທີ່ຂອງໃຜລາວ.</span></div><div style=\"\"><br></div><div style=\"\"><b>II. ໜ້າທີ່ຂອງບໍລິສັດ.</b></div><div style=\"margin-left: 25px;\"><br></div><div style=\"text-align: justify;\">ເປັນບໍລິສັດ ທີ່ໃຫ້ການລົງທຶນ, ບໍລິການ, ແກ້ໄຂ ແລະ ພັດທະນາ ວຽກງານໄອທີຄົບວົງຈອນ, ນຳເຂົ້າ ແລະ ຈຳໜ່າຍ, ວາງລະບົບ ແລະ ຕິດຕັ້ງກ້ອງວົງຈອນປິດ, ລະບົບຮັກສາຄວາມປອດໄພ ທັນສະໄໝ ຍີຫໍ້ຊັ້ນນຳຕ່າງໆຂອງໂລກ ຄື: ດາຫົວ ເທັກໂນໂລຢີ (Dahua Technology) ມີຍອດຂາຍຊັ້ນນຳລະດັບໂລກ, ປະຈຸບັນຢືນຢູ່ອັນດັບ 02 ຂອງໂລກ 5 ປີລຽນຕິດ ສຳລັບກ້ອງວົງຈອນປິດ, ລະບົບຮັກສາຄວາມປອດໄພຮອບດ້ານ, ຢຶນຢູ່ອັນດັບ 04 ຂອງໂລກໃນປີ 2016, ອັນດັບ 05 ຂອງໂລກໃນປີ 2015 ດ້ານລະບົບຮັກສາຄວາມປອດໄພ. ໃຫ້ບໍລິການ ແລະ ຮັບພັດທະນາ ລະບົບ ແອັບມືຖື, ລະບົບໂປຼແກຼມ, ລະບົບເວັບໄຊ ຕາມຄວາມຕ້ອງການ ຂອງລູກຄ້າ ແລະ ໃຫ້ບໍລິການ ລະບົບຫ້ອງຮຽນ, ຫ້ອງສອນ ທັງແບບອອນລາຍ ແລະ ນອກສະຖານທີ່.&nbsp;<br></div><div style=\"margin-left: 25px;\"><br></div><div style=\"\"><b>III. ການບໍລິການ.</b></div><div style=\"margin-left: 25px;\"><br></div><div style=\"\">- ລົງທຶນ ຮັບເໝົາ, ອອກແບບ ແລະ ຕິດຕັ້ງ ລະບົບຮັກສາຄວາມປອດໄພ ທັນສະໄໝ ຄົບວົງຈອນ.</div><div style=\"\"><span style=\"font-size: 1rem;\">- ບໍລິການຮັບອອກແບບ ແລະ ພັດທະນາ ແອັບມືຖື ທັງ Android ແລະ IOS.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- ບໍລິການຮັບອອກແບບ ແລະ ພັດທະນາ ໂປຣແກຣມຄຸ້ມຄອງລະບົບ ທັງ Online ແລະ Offline.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- ບໍລິການຮັບອອກແບບ ແລະ ພັັດທະນາ ເວັບໄຊ້ ໃນຍຸກແຫ່ງການຄົ້ນຫາ SEO.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- ຈຳໜ່າຍ, ລົງທຶນຕິດຕັ້ງ ແລະ ສ້ອມແປງ ຄອມພິວເຕີ, ລະບົບເຄືອຂ່າຍ ແລະ ອຸປະກອນໄອທີ ທຸກຊະນິດ.</span></div><div style=\"margin-left: 25px;\"><br></div><div style=\"\"><b>IV. ວິໄສທັດ ແລະ ເປົ້າໝາຍ.</b></div><div style=\"margin-left: 25px;\"><br></div><div style=\"text-align: center; margin-left: 25px;\"><b>ຄຳຂວັນປະຈຳ: “ທັນຍຸກ ທັນສະໄໝ ບໍລິການດ້ວຍນໍ້າໃຈ ເຮົາພ້ອມຮັບໃຊ້ສັງຄົມ”</b></div><div style=\"text-align: center; margin-left: 25px;\"><b><br></b></div><div style=\"text-align: justify; \">ດຳເນີນທຸລະກິດ ພາຍໃຕ້ກົດໝາຍ ແລະ ລະບຽບການຂອງປະເທດ ສາທາລະນະລັດ ປະຊາທິປະໄຕ ປະຊາຊົນລາວ ຢ່າງເຂັ້ມງວດ,&nbsp;<span style=\"font-size: 1rem;\">ການບໍລິການ ເປັນເປົ້າໝາຍຫຼັກ ຂອງບໍໍລິສັດ, ພວກເຮົາໄດ້ຖືເອົາການບໍໍລິການຂື້ນມາແຖວໜ້າທີ່ ວຽກງານເພື່ອເຮັດແນວໃດໃຫ້ຫັນສູ່ ການບໍລິການຕາມມາດຕະຖານຂອງສາກົນ ແລະ ຄວາມເພິ່ງພໍໃຈຂອງລູກຄ້າ,&nbsp;</span><span style=\"font-size: 1rem;\">ບຸກຄະລາກອນທີ່ດີເດັ່ນ, ມີຄວາາມຮູ້, ມີຄວາາມສາມາດ ແລະ ມີຄວາມຫ້າວຫັນ ແມ່ນໝາກຫົວໃຈ ຂອງບໍລິສັດ ເພາະທຸລະກິດພວກເຮົາ ເປັນທຸລະກິດ ແຫ່ງຍຸກເທັກໂນໂລຂີ ຂໍ້ມູນຂ່າວສານ.&nbsp;</span><span style=\"font-size: 1rem;\">ນຳເອົາເທັກໂນໂລຊີ ທີໃໝ່ໆ ແລະ ທັນຕາມຍຸກ, ທັນຕາມສະໄໝ ເພື່ອມາໝູນໃຊ້ ແລະ ພັດທະນາບ້ານເກີດ ເມືອງນອນຂອງຕົນ ເພື່ອໃຫ້ທັນສະໄໝກັບບ້ານເມືອງເພີ່ນ ຕາມແຜນພັດທະນາເສດຖະກິດ ຂອງພັກ ແລະ ລັດວາງໄວ້.&nbsp;</span><span style=\"font-size: 1rem;\">ກໍ່ສ້າງບຸກຄະລາກອນ ແລະ ບຸກຄົນ ທີ່ຕ້ອງການຢາກພັດທະນາຕົນເອງ ໃນດ້ານວຽກງານເທັກໂນໂລຢີ ຂໍ້ມູນຂ່າວສານເພື່ອ ອອກຮັບໃຊ້ສັງຄົມ ໃຫ້ໄດ້ຫຼາຍ ເພື່ອຊ່ວຍກັນ ພັດທະນາ ແລະ ສ້າງສາ ປະເທດຊາດ.</span></div><div style=\"\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"\"><b>V. ໂຄງຮ່າງການຈັດຕັ້ງ.</b></div><div style=\"\"><br></div><div style=\"text-align: center; \"><b>ບໍລິສັດ ຊີໄອທີ ຈໍາກັດ ພຽງຜູ້ດຽວ ປະກອບມີໂຄງຮ່າງການຈັດຕັ້ງລາຍລະອຽດດັ່ງລຸ່ມ:</b></div><div style=\"text-align: center; \"><b><br></b></div><div style=\"\">- ສະພາບໍລິຫານ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ.</div><div style=\"\"><span style=\"font-size: 1rem;\">- ຄະນະອຳນວຍການ ບໍລິສັດ.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- ຄະນະພະແນກການ ບໍລິສັດ.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- ພະນັກງານໃນສັນຍາ.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- ພະນັກງານທົດສອບວຽກ.</span></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"\"><b>VI. ລາຍການເຄື່ອນໄຫວຜ່ານມາ ຫຼື Profiles.</b></div><div style=\"\"><div style=\"text-align: center;\"><b><br></b></div><b style=\"font-size: 1rem; text-align: center;\">ຂໍ້ມູນ ການເຄື່ອນໄຫວ ຂອງບໍລິສັດ ໂດຍລວມແມ່ນ ໄດ້ບັນທຶກໄວ້ ໃນຂໍ້ມູນ Facebook Fan Page ຂອງບໍລິສັດ ລາຍລະອຽດດັ່ງລູ່ມນີ້:</b></div><div style=\"margin-left: 25px;\"><br></div><div style=\"margin-left: 25px;\"><a href=\"https://www.facebook.com/citsole\" target=\"_blank\">ການເຄືຶ່ອນໄຫວລວມ ກ່ຽວກັບ ບໍລິສັດ ຊີໄອທີ ຈໍາກັດຜູ້ດຽວ.</a></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><a href=\"https://www.facebook.com/DaHuaLaos\" target=\"_blank\">ການເຄື່ອນໄຫວ ກ່ຽວກັບ ກ້ອງວົງຈອນປິດ ໃນໄລຍະຜ່ານມາ.</a></span></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><a href=\"https://www.facebook.com/citdev.la\" target=\"_blank\">ການເຄື່ອນໄຫວ ກ່ຽວກັບ ການພັດທະນາ.</a></span></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><a href=\"https://www.facebook.com/citelearning\" target=\"_blank\">ການເຄື່ອນໄຫວ ກ່ຽວກັບ ຫ້ອງຮຽນອອນລາຍ.</a></span></div><div style=\"\"><br></div></div>', '<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 100px;\" data-filename=\"LogoSmall80.png\"><b style=\"font-size: 1rem;\"><br></b></div><div style=\"text-align: center;\"><b style=\"font-size: 1rem;\"><br></b></div><div style=\"text-align: center;\"><b style=\"font-size: 1rem;\">CIT SOLE CO.,LTD</b></div><div style=\"text-align: left;\"><div style=\"\"><b>I. Overview.</b></div><div style=\"\"><br></div><div style=\"text-align: justify;\">CIT established on 09/09/2009 during that period, renamed as CIT Personal Computer and officially became the sole CIT Co., Ltd. on 01/01/2016, divided into 5 divisions: Accounting and Sales Department, Technical and Treasury Department, Development and Services Division, Divisional Division .</div><div style=\"\"><br></div><div style=\"\"><b>II. Duties of the company.</b></div><div style=\"\"><br></div><div style=\"text-align: justify;\">Companies providing investment services, solutions and development of IT turnkey, import and distribution system and install CCTV systems keep safe modern leading brand of the world leaders in technology (Dahua Technology) sales leading the world, now stands at rank 02 of the world 5 consecutive years for CCTV, systems security comprehensive Approved is ranked 04 in the world in 2016, ranked 05 in the world in 2015 and the Systems Security . Provides and develops mobile app systems, software systems, web systems according to customer needs and provides classroom and classroom systems, both online and off-site.</div><div style=\"\"><br></div><div style=\"\"><b>III. Services.</b></div><div style=\"\"><br></div><div style=\"\">- Invest in, design and install a complete security system.</div><div style=\"\"><span style=\"font-size: 1rem;\">- Design and development of mobile apps for both Android and IOS.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem;\">Design and development of system management software for both online and offline.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem;\">Website design and development services in the era of SEO search.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">- Invest in, install and repair computers, network systems and all kinds of IT equipment.</span></div><div style=\"\"><br></div><div style=\"\"><b>IV. Vision and goals.</b></div><div style=\"\"><br></div><div style=\"text-align: center; \"><b>Motto: \"Modern, service with heart, ready to serve society\"</b></div><div style=\"\"><br></div><div style=\"text-align: justify;\">Doing business under the laws and regulations of the Lao People\'s Democratic Republic strictly, service is the main aim of the company, we have taken a number of up-front work to do to turn the service standards of international and satisfaction of customers, personnel outstanding, conclude that it was the opinion of the ability and enthusiasm is at the heart of the company because the business our business application technology ballistics information. Bringing the latest and most up-to-date technology to apply and develop their hometowns in order to keep up with their hometowns in accordance with the economic and development plans set by the Party and the state. Build personnel and individuals who want to develop themselves in the field of information technology to serve the society as much as possible to help develop and build the nation.</div><div style=\"\"><br></div><div style=\"\"><b>V. Organizational Structure.</b></div><div style=\"\"><br></div><div style=\"text-align: center; \"><b>CIT Sole Proprietorship includes the following organizational structure:</b></div><div style=\"text-align: center; \"><b><br></b></div><div style=\"\">- CIT Board of Directors Limited.</div><div style=\"\"><span style=\"font-size: 1rem;\">- Board of Directors.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem;\">Department Board.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem;\">Employees in the contract.</span></div><div style=\"\"><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem;\">Job testing staff.</span></div><div style=\"\"><br></div><div style=\"\"><b>VI. Recent Activity List or Profiles.</b></div><div style=\"\"><b style=\"text-align: center; font-size: 1rem;\"><br></b></div><div style=\"\"><b style=\"text-align: center; font-size: 1rem;\">The overall operating information of the company is recorded on the company\'s Facebook Fan Page. Details are as follows:</b></div><div style=\"\"><br></div><div style=\"margin-left: 25px;\"><a href=\"https://www.facebook.com/citsole\" target=\"_blank\">Overall activity of CIT Sole Proprietorship.</a></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><a href=\"https://www.facebook.com/DaHuaLaos\" target=\"_blank\">CIT&nbsp;CCTV movements in the past.</a></span></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><a href=\"https://www.facebook.com/citdev.la\" target=\"_blank\">CIT&nbsp;Development.</a></span></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><a href=\"https://www.facebook.com/citelearning\" target=\"_blank\">Online elearning and classroom activities.</a></span></div><div style=\"margin-left: 25px;\"><span style=\"font-size: 1rem;\"><br></span></div></div>', 1, 1, '2021-08-24 17:00:00', '2021-08-27 18:05:29');
INSERT INTO `pages` (`id`, `title_la`, `title_en`, `slug`, `des_la`, `des_en`, `status`, `user_id`, `created_at`, `updated_at`) VALUES
(2, 'ເງື່ອໄຂການນຳໃຊ້', 'Terms and Conditions', 'terms-and-conditions', '<h4 style=\"text-align: center; \"><b>ຂໍ້ກຳນົດ ແລະ ເງື່ອນໄຂນຳໃຊ້</b></h4><h5 style=\"text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\"><br></span></h5><h5 style=\"text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">ຂໍ້ກຳນົດ ຄຸ້ມຄອງການນຳໃຊ້ເວັບໄຊ ແລະ ແອັບພລິເຄຊັນມືຖື ຂອງ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ (ຫຼື ໝາຍເຖິງ “ພວກເຮົາ”). ກະລຸນາອ່ານຂໍ້ກຳນົດເຫຼົ່ານີ້ໃຫ້ລະອຽດ ໂດຍການເຂົ້າເຖິງ ແລະ ນຳໃຊ້ແພລດຟອມ (Platform), ທ່ານເຫັນດີວ່າທ່ານໄດ້ອ່ານ, ເຂົ້າໃຈ ແລະ ຍອມຮັບຂໍ້ກຳນົດ ລວມທັງຂໍ້ກຳນົດ, ເງື່ອນໄຂເພີ່ມເຕີມ ແລະ ນະໂຍບາຍທີ່ອ້າງອີງຢູ່ໃນທີ່ນີ້. ຖ້າທ່ານບໍ່ເຫັນດີ ຫຼື ຕົກຢູ່ພາຍໃນຂໍ້ກຳນົດ ຂອງພວກເຮົາ ແມ່ນກະລຸນາຢ່າໃຊ້ລະບົບພວກເຮົາ.</span><br></h5><p style=\"text-align: justify; \">ບໍລິສັດ ຊີໄອທີ ສະຫງວນສິດ ແລະ ຈະມີການປ່ຽນແປງ ຫຼື ແກ້ໄຂຂໍ້ກຳນົດເຫຼົ່ານີ້ໄດ້ທຸກເວລາ ຕາມການປັບປຸງນະໂຍບາຍ ຂອງພວກເຮົາ. ຂໍແນະນຳໃຫ້ທ່ານອ່ານ ຂໍ້ກຳນົດເຫຼົ່ານີ້ເປັນປົກກະຕິ, ຈະຖືວ່າທ່ານໄດ້ເຫັນດີນຳ ຂໍ້ກຳນົດທີ່ໄດ້ແກ້ໄຂ ໂດຍການນຳໃຊ້ແພລດຟອມຕໍ່ເນື່ອງຂອງທ່ານຫຼັງຈາກວັນທີໄດ້ອອກແຈ້ງຂໍ້ກຳນົດທີ່ແກ້ໄຂແລ້ວ.</p><p><b>ພວກເຮົາແມ່ນໃຜ ແລະ ພວກເຮົາເຮັດຫຍັງ?</b></p><p style=\"text-align: justify; \">ພວກເຮົາ ເປັນຫົວໜ່ວຍທຸລະກິດໜຶ່ງ ເຊິ່ງອອກຊື່ ເປັນ ບໍລິສັດ ຈຳກັດຜູ້ດຽວ ເປັນບໍລິສັດ ຂອງຄົນລາວ 100% ທີ່ດຳເນີນທຸລະກິດ ທາງດ້ານ ການໃຫ້ບໍລິການ ເຕັກໂນໂລຊີ ຂໍ້ມູນຂ່າວສານ ຮອບດ້ານ ໃນ ສປປ ລາວ ເປັນຕົ້ນແມ່ນ ການຈຳໜ່າຍ ແລະ ຂາຍຜະລິດຕະພັນ ກ້ອງວົງຈອນປິດ, ລະບົບຮັກສາຄວາມປອດໄພ ທັນສະໄໝ ຍີຫໍ່ Dahua Technology, ຜູ້ນຳຄວາມປອດໄພ ລະດັບໂລກ, ຮັບພັດທະນາ ລະບົບແອັບມືຖື.</p><p><b>ການນຳໃຊ້ລະບົບຂອງພວກເຮົາ.</b></p><p style=\"text-align: justify; \">ໃນກໍລະນີ ທີ່ທ່ານຕ້ອງການຊື້ຜະລິດຕະພັນ ອອນລາຍຜ່ານລະບົບ ທ່ານຈຳເປັນ ຈະຕ້ອງລົງທະບຽນເພື່ອເປັນສະມາຊິກໃນລະບົບເຮົາ. ເມື່ອທ່ານລົງທະບຽນເປັນສະມາຊິກພວກເຮົາແລ້ວ ທ່ານຈະໄດ້ປະກອບຂໍ້ມູນສ່ວນຕົວຂອງທ່ານ ລວມທັງທີ່ຢູ່ອີເມວ, ເບີໂທລະສັບມືຖື ແລະ ລະຫັດຜ່ານສະເພາະ (ຮູບແບບ BCRYPT ບໍ່ມີໃຜສາມາດຮູ້ລະຫັດໄດ້). ເພື່ອເຮັດທຸລະກຳສັ່ງຊື້, ຂຶ້ນກັບວ່າທ່ານເລືອກຈະນຳໃຊ້ວິທີການຊຳລະເງິນແບບໃດ, ທ່ານອາດຈະຕ້ອງໄດ້ໃຫ້ລາຍລະອຽດບັດເຄຣດິດຂອງທ່ານແກ່ພວກເຮົາ, ບໍ່ຄວນເອົາລະຫັດຜ່ານສະເພາະຂອງທ່ານໃຫ້ກັບຄົນອື່ນ ແລະ ທ່ານເຫັນດີເກັບຮັກສາມັນໄວ້ເປັນຄວາມລັບຢູ່ຕະຫຼອດເວລາ, ບັນທຶກໄວ້ສຳລັບກໍລະນີຂອງການສໍ້ໂກງ ຫຼື ການນຳໃຊ້ໄປໃນທາງທີ່ຜິດທີ່ບໍ່ແມ່ນຄວາມຜິດຂອງທ່ານ, ທ່ານຍອມຮັບວ່າການສັ່ງຊື້ທັງໝົດ ທີ່ໄດ້ສັ່ງພາຍໃຕ້ບັນຊີຂອງທ່ານ ແມ່ນຄວາມຮັບຜິດຊອບຂອງທ່ານທັງໝົດ.&nbsp;&nbsp;</p><p><span style=\"font-size: 1rem;\"><b>ຂໍ້ຫ້າມ.</b></span><br></p><p><span style=\"font-size: 1rem;\">- ການໃຊ້ນຳໃຊ້ລະບົ ເພື່ອຈຸດປະສົງ ທີ່ຜິດກົດໝາຍ ຂອງ ພັກ ແລະ ລັດຖະບານ ຂອງ ສປປ ລາວ ວາງອອກ.</span></p><p><span style=\"font-size: 1rem;\">- ການນຳສະເໜີເນື້ອຫາໃດໜຶ່ງ ທີ່ລະເມີດສິດຊັບສິນທາງປັນຍາ, ສິດຄວາມເປັນສ່ວນຕົວ, ສິດໃນການເປີດເຜີຍ, ສິດຄວາມລັບທາງການຄ້າ ຫຼື ສິດອື່ນໆໃດໜຶ່ງຂອງພາກສ່ວນໃດໜຶ່ງ.</span></p><p><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem;\">ເນື້ອຫາທີ່ເປັນສິ່ງລາມົກ, ອານະຈານ, ທຳລາຍຊື່ສຽງ, ຂົ່ມຂູ່ມ, ລ່ວງລະເມີດ, ໃຊ້ໄປໃນທາງທີ່ຜິດ, ໃສ່ຮ້າຍ, ດຮັດໃຫ້ບຸກຄົນອື່ນເສຍຫາຍ.</span></p><p><span style=\"font-size: 1rem;\">- ການປອມຕົວເປັນຄົນອື່ນ ເພື່ອສ້າງຄວາມປັ່ນປ່ວນພາຍໃນ ເຮັດໃຫ້ເກີດມີຄວາມເສຍຫາຍພາຍໃນ ແມ່ນທາງ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຈະສຶບສວນ ແລະ ດຳເນີນຄະດີຕາມລະບຽບກົດໝາຍຂອງບ້ານເມືອງວາງອອກ.</span></p><p>- ແລະ ຂໍ້ຫ້າມອື່ນໆ ທີ່ຜິດຕໍ່ກົດໝາຍບ້ານເມືອງ ວາງອອກເປັນແຕ່ລະໄລຍະ.</p><p><b>ຊັບສິນທາງປັນຍາ.</b></p><p style=\"text-align: justify; \">ທຸກເຄື່ອງໝາຍການຄ້າ, ໂລໂກ້, ຮູບພາບ ແລະ ເຄື່ອງໝາຍບໍລິການ, ລວມທັງຂໍ້ກຳນົດເຫຼົ່ານີ້ຕາມທີ່ສະແດງຢູ່ໃນແພລດຟອມ ຫຼື ຢູ່ໃນເອກະສານການຕະຫຼາດຂອງພວກເຮົາ, ບໍ່ວ່າໄດ້ຈົດທະບຽນ ຫຼື ບໍ່ຈົດທະບຽນກໍ່ຕາມ, ແມ່ນເປັນຊັບສິນທາງປັນຍາຂອງ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ແລະ/ຫຼື ພາກສ່ວນທີສາມຜູ້ທີ່ໃຫ້ສິດພວກເຮົານຳໃຊ້ (ລວມກັນແມ່ນ “ເຄື່ອງໝາຍການຄ້າ”). ທ່ານຕ້ອງບໍ່ນຳໃຊ້, ອັດສຳເນົາ, ຜະລິດໃໝ່, ຕີພິມໃໝ່, ອັບໂຫຼດ, ໂພສ, ສົ່ງ, ແຈກຢາຍ ຫຼື ດັດແປງເຄື່ອງໝາຍການຄ້າເຫຼົ່ານີ້ດ້ວຍວິທີໃດໜຶ່ງໂດຍບໍ່ມີຄຳຍິນຍອມເປັນລາຍລັກອັກສອນຈະແຈ້ງຂອງພວກເຮົາກ່ອນ. ຫ້າມນຳໃຊ້ເຄື່ອງໝາຍການຄ້າຂອງ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ໃນເວັບໄຊອື່ນໃດໜຶ່ງທີ່ພວກເຮົາບໍ່ໄດ້ອະນຸມັດໃຫ້ຢ່າງເດັດຂາດ. ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຈະບັງຄັບໃຊ້ສິດທິຊັບສິນທາງປັນຍາຂອງຕົນເອງຂັ້ນເດັດຂາດໃນລະດັບທີ່ກົດໝາຍອະນຸຍາດ, ລວມທັງການຟ້ອງຮ້ອງທາງອາຍາ. ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ບໍ່ຮັບປະກັນ ຫຼື ເປັນຕົວແທນສະແດງວ່າການນຳໃຊ້ເອກະສານທີ່ສະແດງຢູ່ໃນແພລດຟອມຈະບໍ່ລະເມີດສິດຂອງພາກສ່ວນທີສາມທີ່ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ບໍ່ແມ່ນເຈົ້າຂອງ ຫຼື ມີຫຸ້ນສ່ວນນຳ. ການນຳໃຊ້ເອກະສານໃດໜຶ່ງໃນແພລດຟອມແມ່ນຄວາມສ່ຽງຂອງທ່ານເອງທັງໝົດ.</p><p><span style=\"font-size: 1rem;\"><b>ການສັ່ງຊື້.</b></span><br></p><p style=\"text-align: justify; \">- ເມື່ອທ່ານສ້າງທຸລະກຳສັ່ງຊື້ ເທິງລະບົບ ຂອງ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ, ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຈະຢືນຢັນການສັ່ງຊື້ຂອງທ່ານໂດຍການສົ່ງອີເມວຢືນຢັນ ໃຫ້ທ່ານໂດຍມີໃບຮັບການສັ່ງຊື້ ຫຼື ຊ່ອງທາງອື່ນໆ ທີ່ອຳນວຍຄວາມສະດວກ, ການສັ່ງຊື້ຈະລວມເອົາຄ່າຈັດສົ່ງ ແລະ ອາກອນທີ່ບັງຄັບໃຊ້ໃດໜຶ່ງ (ຕົວຢ່າງ: ອາກອນສິນຄ້າ, ບໍລິການ, ອາກອນມູນຄ່າເພີ່ມ ແລະ ອື່ນໆ ຕາມລະບຽບກົດໝາຍວາງອອກ).&nbsp;&nbsp;</p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- ຫຼັງຈາກທີ່ທ່ານໄດ້ກວດກາລະອຽດ ລາຍການສັ່ງຊື້ ຂອງຕົນເອງ ແລະ ກົດຢືນຢັນສັ່ງຊື້ແລ້ວ ແມ່ນ ທາງ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຫຼື ຮ້ານຕົວແທນຈຳໜ່າຍໃນລະບົບ ແລ້ວ ແມ່ນທາງພວກເຮົາ ຈະບໍ່ສາມາດຍົກເລີກທຸລະກຳນັ້ນໄດ້ ຫຼື ບໍ່ສາມາດສົ່ງເງິນຄືນໄດ້ ໃນແຕ່ລະກໍລະນີໃດໆ.</span><span style=\"font-size: 1rem;\">&nbsp;&nbsp;</span></p><p><b>ລາຄາ ແລະ ຄ່າໃຊ້ຈ່າຍທີ່ຈຳເປັນ.</b></p><p style=\"text-align: justify; \">- ລາຄາອ້າງອີງໄວ້ໃນລະບົບ ຈະປະກົດຂຶ້ນເປັນສະກຸນເງິນ ຂອງປະເທດທີ່ສາມາດນຳໃຊ້ໄດ້ ແລະ ຂຶ້ນກັບອາກອນທີ່ນຳໃຊ້ຢູ່. ລາຄາ ແລະ ການສະເໜີໃຫ້ໃນລະບົບ ອາດຈະແຕກຕ່າງຈາກລາຄາ ແລະ ທ່ານຍອມຮັບການສະເໜີທີ່ຜູ້ຂາຍຂອງພວກເຮົາສະເໜີໃຫ້ນັ້ນ (ບໍ່ວ່າໃນເວັບໄຊຂອງພວກເຂົາເອງ, ແອັບພລິເຄຊັນມືຖື).</p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- ວິທີທີ່ພວກເຮົາສະແດງຜົນລາຄາສິນຄ້າ ຂອງພວກເຮົາອາດຈະແຕກຕ່າງຂຶ້ນກັບຜູ້ຂາຍ ແລະ ລາຄາທີ່ສະທ້ອນໃຫ້ເຫັນໃນລະບົບຂອງພວກເຮົາອາດຈະ:&nbsp;</span><span style=\"font-size: 1rem;\">GST (ອາກອນສິນຄ້າ ແລະ ບໍລິການ), VAT (ອາກອນມູນຄ່າເພີ່ມ) ຫຼື ອາກອນທຽບເທົ່າອື່ນໆດັ່ງກ່າວ, ການ</span><span style=\"font-size: 1rem;\">ຍົກເວັ້ນ GST (ອາກອນສິນຄ້າ ແລະ ບໍລິການ), VAT (ອາກອນມູນຄ່າເພີ່ມ) ຫຼື ອາກອນທຽບເທົ່າອື່ນໆດັ່ງກ່າວ.</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">-&nbsp;</span><span style=\"font-size: 1rem; text-align: left;\">ລາຍລະອຽດຂອງລາຄາ ແລະ ຄ່າເກັບເພີ່ມຕ່າງໆສະແດງໃຫ້ເຫັນກ່ອນ ການແຈ້ງບິນເກັບເງິນ (Checkout). ເມື່ອທ່ານທຳການສັ່ງຊື້, ທ່ານເຫັນດີນຳທຸກຈຳນວນ, ຄ່າເກັບເພີ່ມ ແລະ ຈຳນວນເງິນ ‘ທັງໝົດ’ ສຸດທ້າຍທີ່ສະແດງໃຫ້ກັບທ່ານ.&nbsp;&nbsp;</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem; text-align: left;\">-&nbsp;</span><span style=\"font-size: 1rem; text-align: left;\">ຄ່າຈັດສົ່ງ ສາມາດເກັບໄດ້ໃນທຸກໆການສັ່ງຊື້ ນອກຈາກວ່າ:&nbsp;</span><span style=\"font-size: 1rem; text-align: left;\">ທ່ານເລືອກຮູບແບບທີ່ຈະໄປຮັບເອົາເຄື່ອງ ດ້ວຍຕົວທ່ານເອງ,&nbsp;</span><span style=\"font-size: 1rem; text-align: left;\">ທ່ານມີຄູປ໋ອງໂປຣໂມຊັນ ຫຼື ຫຼຸດລາຄາທີ່ນຳໃຊ້ໄດ້ ແລະ ນຳໃຊ້ມັນໄດ້ຢູ່ທີ່ບ່ອນແຈ້ງອອກຈ່າຍເງິນ (Checkout).&nbsp;&nbsp;</span></p><p><b>ວິທີການຊຳລະເງິນ.</b></p><p style=\"text-align: justify; \"><span style=\"text-align: left;\">- ທ່ານສາມາດເລືອກຈ່າຍຄ່າ ການສັ່ງຊື້ໄດ້ໂດຍການນຳໃຊ້ວິທີການຊຳລະອື່ນໃດໜຶ່ງໃນລະບົບ ເຊັ່ນ: ເງິນສົດ, ເງິນໂອນ ແລະ ອື່ນໆ ທີ່ມີກຳນົດໃນລະບົບ.</span></p><p style=\"text-align: justify; \"><span style=\"text-align: left;\">-&nbsp;</span><span style=\"font-size: 1rem; text-align: left;\">ທ່ານຕ້ອງໃຫ້ແນ່ໃຈວ່າ ທ່ານມີເງິນພຽງພໍ ໃນການກະກຽມການຊຳລະ ຕາມລາຍການສັ່ງຊື້ຂອງຕົນເອງ.</span></p><p><span style=\"font-size: 1rem;\"><b>ການຈັດສົ່ງ.</b></span><br></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຈະຈັດສົ່ງສິນຄ້າທີ່ທ່ານສັ່ງຊື້ ໄປຕາມທີ່ຢູ່ ທີ່ພວກທ່ານໄດປະກອບໃນຟອມລາຍການສັ່ງຊື້ ຫຼື ຕາມສະຖານທີ່ ທີ່ລູກຄ້າ ຕ້ອງການຈັດສົ່ງໃຫ້, ຖ້າເປັນສິນຄ້າ ຕ່າງແຂວງ ພວກເຮົາກໍ່ຈະໄປສົ່ງຕໍ່ ບັນດາຫົວໜ່ວຍ ທຸລະກິດ ທີ່ໃຫ້ບໍລິການຂົນສົ່ງດ່ວນ ຫຼື ຕາມການປະສານງານຕົວຈິງ ຂອງລູກຄ້າ.</span></p><p style=\"text-align: justify; \"><br></p>', '<h4 style=\"text-align: center; \"><b>Terms and conditions</b></h4><p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">The terms and conditions governing the use of the website and mobile application of CIT SOLE CO.,LTD (or referred to as “us”). Please read these terms and conditions carefully by accessing and using the Platform, you agree that you have read, understand and accept the terms, including the terms, additional terms and policies referenced herein. If you do not agree or fall within our terms, please do not use our system.</p><p><span style=\"text-align: justify; font-size: 1rem;\">CIT SOLE CO.,LTD&nbsp;</span>reserves the right and may change or modify these terms at any time in accordance with our policy. It is recommended that you read these terms and conditions regularly, as you agree to the terms and conditions resolved by your continued use of the platform after the date the revised terms are posted.</p><p><b>Who are we and what do we do?</b></p><p style=\"text-align: justify; \">We are a business group which is named as a sole proprietorship company, a 100% Lao company that conducts business in providing comprehensive information technology services in Lao PDR, such as distribution and sale of CCTV products, security systems, security systems, security systems.</p><p><b>Using our system.</b></p><p style=\"text-align: justify; \">If you want to buy products online through the system, you will need to register to be a member of our system. When you register as a member of us you will be given your personal information including email address, mobile phone number and specific password (BCRYPT format no one can know the code). In order to make a purchase, depending on which payment method you choose to use, you may need to provide us with your credit card details, do not give your unique password to anyone else and you agree to keep it confidential at all times, keeping track of any fraudulent or misleading accounts receivable.</p><p><b>Prohibitions.</b></p><p>- The use of the system for illegal purposes by the Party and Government of the Lao PDR.</p><p>- Submission of any content that infringes on any intellectual property rights, privacy, disclosure rights, trade secrets or any other rights of any third party.</p><p>- Pornographic material, profanity, defamation, harassment, abuse, abuse, slander, or harm to another person.</p><p><span style=\"font-size: 1rem;\">- Disguise as someone else to create internal turmoil causing internal damage is the sole responsibility of CIT Co., Ltd. to investigate and prosecute in accordance with the rules and regulations issued by the village.</span></p><p>- And other prohibitions that violate the laws of the village and district issued periodically.</p><p><b>Intellectual property.</b></p><p style=\"text-align: justify; \">All trademarks, logos, graphics and service markers, including these terms as they appear on our platform or in our marketing materials, whether registered or unregistered, are the intellectual property of CIT SOLE CO.,LTD&nbsp;and / or our third party licensors. You must not use, copy, reproduce, publish, upload, post, transmit, distribute or modify these commercial materials in any way without our express written consent. CIT SOLE CO.,LTD&nbsp;COMPANY LIMITED USE ON ANY OTHER SITE IS NOT USED. CIT SOLE CO.,LTD&nbsp;will enforce its intellectual property rights to the fullest extent permitted by law, including criminal prosecution. CIT Co., Ltd. does not warrant or represent that the use of the materials displayed on the platform will not infringe the rights of third parties that CIT Co., Ltd. is not the sole owner or shareholder. Use of any document on the platform is at your own risk.</p><p><b>Orders.</b></p><p style=\"text-align: justify; \">- When you create a purchase order on the system of CIT Limited, CIT Limited will confirm your order by sending you a confirmation email with an order receipt or other convenient channel, the order will include shipping and handling taxes and other applicable taxes, fees and charges (for example).</p><p style=\"text-align: justify;\">- After you have checked the details of your order and click to confirm the order is the only CIT company or system dealer in the system, we will not be able to cancel the transaction or can not be refunded in any case.</p><p style=\"text-align: justify; \"><b>Prices and expenses required.</b></p><p style=\"text-align: justify; \">The quoted price in the system will appear in the applicable currency of the country and subject to the applicable tax. Prices and offers on the system may vary by price and you agree to any offer made by our vendors (whether on their own site, mobile application).</p><p style=\"text-align: justify; \">- The way we display the prices of our goods may vary depending on the seller and the prices reflected in our system may be: GST (Tax on Goods and Services), VAT (Value Added Tax) or other equivalent taxes, GST exemption (VAT) or other VAT (or VAT).</p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- Details of prices and surcharges are shown before checkout. When you place an order, you agree to the full amount, surcharge and final ‘total’ amount shown to you.</span><br></p><p style=\"text-align: justify; \">- Delivery fee can be collected on every order unless: You choose the form to pick up the product yourself, you have a promotional coupon or a discount that can be used and use it at the checkout.</p><p style=\"text-align: justify; \"><b>How to pay.</b></p><p style=\"text-align: justify; \">- You can choose to pay for the order by using any other payment method in the system, such as cash, money transfer and others that are limited in the system.</p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- You need to make sure you have enough money to prepare for the payment on your own order.</span><br></p><p style=\"text-align: justify; \"><b>Delivery.</b></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">CIT SOLE CO.,LTD</span>&nbsp;will deliver the goods you ordered to the address you provided in the order form or to the place where the customer wants to deliver, if the goods are out of province, we will send to the business units that provide express delivery or according to the actual coordination of the customer.</p>', 1, 1, '2021-08-24 17:00:00', '2021-08-27 07:10:55');
