INSERT INTO `services` (`id`, `image`, `name_la`, `name_en`, `des_la`, `des_en`, `status`, `del`, `created_at`, `updated_at`) VALUES
(1, 'upload/service/1629739598cctv-dev.png', 'ຈຳໜ່າຍ  Dahua Technology', 'Dahua Technology Distributor', '<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 25%;\" data-filename=\"Dahua.png\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Zhejiang Dahua Technology Co., Ltd. (Dahua Technology) ເປັນບໍລິສັດຊັ້ນນຳລະດັບໂລກ ທີ່ຈຳໜ່າຍລະບົບຮັກສາຄວາມປອດໄພ ທັນສະໄໝຮອບດ້ານ ເຊັ່ນ: ລະບົບກ້ອງວົງຈອນປິດ, ລະບົບລ໋ອກຄົວເຮືອນ, ອາຄານທັນສະໄໝ, ລະບົບແຈ້ງເຕືອນການບຸກລຸກ, ລະບົບໄມ້ກ້ານທັນສະໄໝ ແລະ ອື່ນໆ ທີ່ສາມາດຄູ້ມຄອງ ແລະ ຈັດການຜ່ານມືຖືໄດ້ ດ້ວຍລະບົບ Software ທີ່ພັດທະນາຂື້ນເອງດ້ວຍຊ່ຽວຊານມືອາຊີບ, ເຊິ່ງມີສະຖານທີ່ຕັ້ງຢູ່ ແຂວງຮັງໂຈ, ປະເທດ ສປ ຈີນ, ມີຍອດສິນຄ້າສົ່ງອອກອັນດັບ 1 ຂອງໂລກ ແລະ ມີຍອດຂາຍຜະລິດຕະພັນລວມເປັນອັນດັບ 02 ໃນທົ່ວໂລກ ທາງດ້ານລະບົບຮັກສາຄວາມປອດໄພຮອບດ້ານ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><div>Dahua Technology ມີຫ້ອງການສາຂາປະຈຳຢູ່ 200 ແຂວງໃນທົ່ວຈີນ ແລະ ມີ 54 ສາຂາປະຈຳຢູ່ບັນດາປະເທດພັດທະນາ ຂອງແຕ່ລະທະວີບຄື: ອາເຊຍປາຊີຟິກ, ອາເມຣິກາໃຕ້, ອາເມຣິກາເໜືອ, ເອີຣົບ, ອາຟຼິກກາ ແລະ ບັນດາປະເທດພາກພື້ນ ເພື່ອເຮັດໜ້າທີຈຳໜ່າຍຜະລິດຕະພັນ ແລະ ໃຫ້ບໍລິການແກ່ລູກຄ້າໄດ້ທົ່ວເຖິງ. Dahua Technology ມີໂຊລູຊັ່ນ ທີ່ທັນສະໄໝຫຼາຍດ້ານ ເພື່ອເປັນສ່ວນໜຶ່ງ ໃນການຮັກສາຄວາມປອດໄພ ດ້ວຍລະບົບກ້ອງອັດສະລີຍະ ເຊັ່ນ: ລະບົບຕົວເມືອງອັດສະລີຍະ, ລະບົບໄຟແດງທັນສະໄໝ (ໃນນີ້ ປະເທດ ສປປ ລາວ ເຮົາກໍ່ໄດ້ນຳໃຊ້ລະບົບນີ້ ເພື່ອຮັກສາຄວາມປອດໄພບັນດາຕົວເມືອງ ນະຄອນຫຼວງວຽງຈັນ ແລະ ບັນດາແຂວງອ້ອມຂ້າງ), ລະບົບຈັບຄວາມໄວແບບໂອໂຕ, ລະບົບຮັກສາຄວາມປອດໄພ ຮ້ານຊັບພະສິນຄ້າໃຫຍ່, ລະບົບທະນາຄານ ທັນສະໄໝ (ສາມາດຈັດການດ້ວຍລະບົບ AI ແລະ ມີການແຈ້ງເຕືອນຜ່ານລະບົບຕ່າງໆເຊັ່ນ: ATM, Center…), ລະບົບຮັກສາຄວາມປອດໄພຕາຂ່າຍ, ເຂື່ອນໄຟຟ້າ, ສະໜາມບິນ, ຂົນສົ່ງ ແລະ ອື່ນໆອີກຫຼາກຫຼາຍ ໂຊລູຊັ່ນ ລ້ວນແລ້ວແຕ່ໃຊ້ລະບົບ Software ທີ່ທັນສະໄໝເຂົ້າໃນການຄວມຄູມ.&nbsp;</div><div>ບາງໂຄງການທີ່ Dahua Technology ຈັດຕັ້ງປະຕິບັດສຳເລັດ ເພື່ອເປັນສ່ວນໜຶ່ງໃນການຮັກຄາຄວາມປອດໄພ ແບບທັນສະໄໝ ມີ: ໂຮງໜັງ Numerous major, ທ່າເຮືອຂົນສົ່ງລະດັບຊາດ China International Import Expo, Rio Olympics ຢູ່ປະເທດບຼາຊິວ, ກອງປະຊູມ G20 ທີ່ຈັດຂື້ນຢູ່ແຂວງຮັງໂຈ G20 Hangzhou Summit, ກອງປະຊູມອາຊ່ຽນຄັ້ງທີ 28, ຄັ້ງທີ 29 ASEAN Summit ທີ່ນະຄອນຫຼວງວຽງຈັນ, Recife Subway ໃນປະເທດບຼາຊິວ ແລະ ອີກຫຼາກຫຼາຍໂຄງການໃນທົ່ວໂລກ.</div></span></div>', '<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 25%;\" data-filename=\"Dahua.png\"><br></div><div style=\"text-align: justify; \"><br></div><div style=\"text-align: justify; \">Zhejiang Dahua Technology Co., Ltd. (Dahua Technology), a leading global distribution systems secure modern comprehensive such systems, CCTV systems, keep house, building modern alarm system intrusion systems, the modern and capable management and through mobile System Software to develop own expert professional, which has locations in the province nest Joseph, of China, has exported 1 and has sold products and is ranked 02 in the world financial system to maintain safe side.</div><div style=\"text-align: justify; \"><br></div><div style=\"text-align: justify; \">Dahua Technology has offices in 200 provinces across China and 54 offices in the developing countries of Asia-Pacific, South America, the Americas, Europe, Africa and other countries to provide products and services to customers. Dahua Technology solutions to more modern side as part of maintaining security systems with cameras Ashley term as a city intelligent polymer system light modern (in this country Laos\'ve used this system to maintain the security of the city capital and neighboring provinces), signal speed auto, maintenance and safety Shop supermarkets, the system bank modern (can deal with the AI ​​and notification system such as: ATM, Center ...), systems security grids, dams, airports, transport And many other solutions all use state-of-the-art software to control.</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: justify; \">Some of the projects that Dahua Technology has successfully implemented to be part of modern security include: Numerous major mills, China International Import Expo, Rio Olympics in Brazil, G20 summit in Hangzhou, G20 Hangzhou Summit, 29th ASEAN Summit</div>', 1, 1, '2021-01-01 08:02:34', '2021-09-06 22:38:55');
INSERT INTO `services` (`id`, `image`, `name_la`, `name_en`, `des_la`, `des_en`, `status`, `del`, `created_at`, `updated_at`) VALUES
(2, 'upload/service/1627141653mobile-app-dev.png', 'ຮັບພັດທະນາ ແອັບມືຖື ຕາມຕ້ອງການ', 'Mobile App Development', '<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 25%;\" data-filename=\"mobile-app-dev.png\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຮັບພັດທະນາ ແອັບມືຖື ຫຼື Mobile App ຕາມຄວາມຕ້ອງການລູກຄ້າ ທັງລະບົບ Android, IOS, Huawei AppGellery ໂດຍນຳໃຊ້ ເຕັກໂນໂລຊີ ທີ່ທັນສະໄໝ ໃນຍຸກ ແຫ່ງປະຈຸບັນ ໃຊ້ເວລາໜ້ອຍ ໃນການພັດທະນາ ແລະ ບົນພື້ນຖານການເຮັດວຽກແບບຍືນຍຸ່ນດ້ວຍ UI/UX&nbsp; ພ້ອມລະບົບ ຮອງຮັບ ການເຮັດວຽກຂອງທຸກຂັ້ນຕອນ ເພື່ອຕອບໂຈດ ທຸກຄວາມຕ້ອງການ ຂອງລູກຄ້າໄດ້ຫຼາຍທີ່ສຸດ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">1. ບໍລິການພັດທະນາໃນຮູບແບບ One Stop Service ຕັ້ງແຕ່ຂັ້ນຕອນອອກແບບ ຈົນເຖິງ ຂັ້ນຕອນການຕະຫຼາດ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">2. ລະບົບ ແອັບມືຖື ທີ່ເປັນລະບົບ ອອນລາຍ Online App ມີລະບົບຈັດການຫຼັງບ້ານ Backend ເປັນຮູບແບບ Web App ເພື່ອຈັດການໂມດູນຕ່າງໆ ຂອງລະບົບ ໃຫ້ອອກມາໄດ້ຕາມຄວາມຕ້ອງການ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">3.&nbsp; ວິດເຄາະ ແລະ ອອກແບບ ແອັບພີເຄຊັ່ນ ດ້ວຍທີມງານທີ່ຊ່ຽວຊານ: ປະສົບການ ໃນການພັດທະນາ ແອັບມືຖື ຫຼື ແອັບຟຼີເຄຊັ່ນ ຫຼາຍກວ່າ 5 ປີ ໂດຍຜ່ານການພັດທະນາ ແອັບມືຖື ທີ່ຫຼາກຫຼາຍຮູບແບບ ເຊັ່ນ: ແອັບມືຖື ແນະນຳອົງກອນ, ແອັບມືຖື eCommerce ລະບົບຂາຍອອນລາຍ, ແອັບມືຖື ສຳລັບທຸລະກິດຂົນສົ່ງ, ແອັບມືຖື ສຳລັບການຕິດຕາມ ແລະ ແອັບມືຖືສະເພາະດ້ານ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">4. ພັດທະນາໄດ້ທຸກຮູບແບບ ຕາມຕ້ອງການ: ອອກແບບ ແລະ ພັດທະນາໃໝ່ ທັງໝົດ ເພື່ອຕອບໂຈດທຸລະກິດ ແລະ ໄດ້ຮັບຜົນປະໂຫຍດສູງສຸດ ສຳລັບລູກຄ້າ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">5. ມອບສິ່ງທີ່ທັນສະໄໝໃຫ້ກັບລູກຄ້າສະເໝີ: ທາງບໍລິສັດເຮົາ ມີທີມງານພັດທະນາລະບົບ ແລະ ທີມງານ IT Support ທີ່ມີການຮຽນຮູ້ສິ່ງໃໝ່ໆຕະຫຼອດ ໂດຍສາມາດ ນຳໃຊ້ເຄື່ອງມື ທີ່ທັນສະໄໝ ໃນການພັດທະນາແອັບມືຖື ໃຫ້ກັບລູກຄ້າ ເພື່ອໃຫ້ທັນກັບຍຸກສະໄໝໃໝ່ຢູ່ເລື້ອຍໆ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">6. ບຳລຸງຮັກສາຕະຫຼອດອາຍຸໃຊ້ງານຂອງລະບົບ: ຫຍິນດີໃຫ້ບໍລິການຫຼັງການຂາຍ ບໍ່ວ່າຈະເປັນການປັບປຸງ, ພັດທະນາຕໍ່ຍອດ ຫຼື ພັດທະນາຂື້ນໃໝ່ ພວກເຮົາ ພ້ອມທີ່ຈະໃຫ້ບໍລິການລູກຄ້າຕະຫຼອດເວລາ.</span></div>', '<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 25%;\" data-filename=\"mobile-app-dev.png\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">CIT SOLE CO., Ltd. is the sole developer Mobile Application a</span><span style=\"text-align: left;\">ccording to the needs of customers, including Android, IOS, Huawei AppGellery, using the latest technology in the current era, spend a lot of time developing and based on sustainable work with UI / UX with a system that supports the work of all stages to meet the needs of all customers.</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">1. One Stop Service&nbsp;</span><span style=\"font-size: 1rem; text-align: left;\">Development</span><span style=\"text-align: left; font-size: 1rem;\">&nbsp;from the design stage to the marketing stage.</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left; font-size: 1rem;\">2.&nbsp;</span><span style=\"text-align: left;\">The online mobile app system has an Backend management system as a Web App to manage the various modules of the system as needed.</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">3.&nbsp;</span><span style=\"text-align: left;\">Analyze and design applications with a team of experts:&nbsp;</span><span style=\"text-align: left;\">Experience working in mobile application development for more than 5 years through the development of various applications. such as Company applications, eCommerce applications, Logistics application, Tracking applications and specialized applications.</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">4.&nbsp;</span><span style=\"text-align: left;\">Can be developed in any form applications on demand:&nbsp;&nbsp;</span><span style=\"text-align: left;\">Design and develop a whole new system. to meet business and benefit the most.</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">5.&nbsp;</span><span style=\"text-align: left;\">Always deliver the latest things to the customers:&nbsp;</span><span style=\"text-align: left;\">We have a system development team that brings new technology to develop for customers to offer. Don\'t be afraid to go out of fashion.</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">6.&nbsp;</span><span style=\"text-align: left;\">Take care of the lifespan of the market:&nbsp;</span><span style=\"text-align: left;\">Happy to provide after-sales service whether it is further developed from the original or made new We are ready to develop at any time.</span></div>', 1, 1, '2021-07-24 15:47:33', '2021-08-24 00:22:59');
INSERT INTO `services` (`id`, `image`, `name_la`, `name_en`, `des_la`, `des_en`, `status`, `del`, `created_at`, `updated_at`) VALUES
(3, 'upload/service/1629739321software-web-dev.png', 'ຮັບພັດທະນາໂປຼແກຼມ ແລະ ເວັບໄຊ', 'Software Website Development', '<p> </p><p style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 25%;\" data-filename=\"software-web-dev.png\"><br></p><p style=\"text-align: justify; \">ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ຮັບພັດທະນາລະບົບ Platform, ລະບົບໂປຼແກຼມ ຕາມຄວາມຕ້ອງການ ຂອງລູກຄ້າ ເຊັ່ນ:&nbsp;<span style=\"font-size: 1rem;\">ລະບົບ Core Banking, ERP, SAP, ລະບົບຂົນສົ່ງ, ລະບົບໂປຼແກຼມຄູ້ມຄອງ, ໂປຼແກຼມບໍລິຫານ, ໂປຼແກຼມຕິດຕາມ, ລະບົບເວັບໄຊ Ecommerce, ເວັບໄຊຂ່າວສານ, ເວັບໄຊອົງກອນ ແລະ ເວັບໄຊຕ່າງໆ</span><span style=\"font-size: 1rem;\">&nbsp;ທັງຮູບແບບ Offline ແລະ Online ນຳໃຊ້ຜ່ານ Cloud Server ດ້ວຍເຕັກໂນໂລຊີ ຊັ້ນນຳລະດັບໂລກ ເຊັ່ນ: .Net Core, C#, PHP, PHP Framework, JavaScript, JavaScript Framework, Flutter, NodeJS....ພ້ອມລະບົບຖານຂໍ້ມູນ ທີ່ມີລະບົບຮັກສາຄວາມປອດໄພສູງ ຄື: Oracle, SQL Server, MySQL, PostgreSQL, MongoDB... ເພື່ອຊ່ວຍຄູ້ມຄອງ ແລະ ບໍລິຫານ ທຸລະກິດຂອງທ່ານ ໃຫ້ຫັນເປັນທັນສະໄໝ ຂື້ນເທື່ອລະກ້າວ ແລະ ບໍລິຫານທຸລະກິດ ໄດ້ທຸກທີ່ ທຸກເວລາ.</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><b>ເປັນຫຍັງຈິ່ງຕ້ອງພັດທະນາຕາມຄວາມຕ້ອງການລູກຄ້າ?</b></span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">ການພັດທະນາ ຕາມຄວາມຕ້ອງການລູກຄ້າ ແມ່ນສາມາດຕອບໂຈດໄດ້ບັນຫາ ທີ່ລູກຄ້າ ກຳລັງພົບຄວາມຫຍຸ້ງຍາກຢູ່ປະຈຸບັນ ແລະ ເພື່ອຖືກຕ້ອງການຕາມ ນະໂຍບາຍ ການຄູ້ມຄອງ ແລະ ການບໍລິຫານ ຂອງລູກຄ້າ ໂດຍຈະເລີ່ມຕົ້ນຕັ້ງແຕ່ ການສຳພາດ ເກັບກຳຂໍ້ມູນແນວຄວາມຄິດຂອງລູກຄ້າ ເພື່ອຜັນຂະຫຍາຍ ແນວຄວມຄິດ ດັ່ງກ່າວ ອອກເປັນລະບົບ ຄູ້ມຄອງ ໃຫ້ຫັນເປັນການບໍລິຫານ ແບບທັນສະໄໝ, ປະຫຍັດທັງເວລາ ແລະ ງົບປະມານ.</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><b>ຂໍ້ດີຂອງການພັດທະນາ ຕາມີຄວາມຕ້ອງການ</b></span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- ຕອບສະໜອງໄດ້ທຸກໜ້າວຽກງານ ທີ່ລູກຄ້າ ຕ້ອງການ ຫັນເປັນທັນສະໄໝ.</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- ສາມາດປັບປຸງ ແລະ ພັດທະນາຕໍ່ຍອດ ໄດ້ຕະຫຼອດ ຕາມຄວາມຕ້ອງການຂອງລູກຄ້າ ເພື່ອເຮັດໃຫ້ການຂະຫຍາຍທຸລະກິດ ໄປໄດ້ຄ່ອງຕົວ.</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">- ງົບປະມານບໍ່ໄດ້ລົງທຶນສູງບາດດຽວ ສາມາດລົງທຶນຕໍ່ຍອດ ເປັນແຕ່ລະໄລຍະໄດ້.</span></p><p style=\"text-align: justify; \"><b>ຂໍ້ເສຍຂອງລະບົບໂປຼແກຼມທີ່ມີແລ້ວ</b></p><p style=\"text-align: justify; \">- ບໍ່ສາມາດຕອບສະໜອງໄດ້ທຸກໜ້າທີວຽກງານ ຕາມຕ້ອງການ ຂອງແຕ່ລະຫົວໜ່ວຍທຸລະກິດໄດ້.</p><p style=\"text-align: justify; \">- ບໍ່ສາມາດປັບປຸງ ຫຼື ພັດທະນາຕໍ່ຍອດຈາກລະບົບເກົ່າ ເປັນລະບົບໃໝ່ໄດ້.</p><p style=\"text-align: justify; \">- ບໍ່ສາມາດອັບເດດລະບົບ, ລ່າສະໄໝ ເຮັດໃຫ້ຫຍຸ້ງຍາກ ແລະ ຕ້ອງໄດ້ປັບປ່ຽນຂໍ້ມູນໃໝ່ຕະຫຼອດ.</p>', '<p> </p><p style=\"text-align: center; \"><img src=\"data:image/png;base64,\" style=\"width: 25%;\" data-filename=\"software-web-dev.png\"><br></p><p style=\"text-align: justify; \">CIT SOLE CO., Ltd. is the sole developer of the platform system, software system according to customer needs, such as Core Banking, ERP, SAP, management system, administration software, tracking software, Ecommerce website, Offline website, Web server and online server and Web server and Web. PHP, PHP Framework, JavaScript, JavaScript Framework, Flutter, NodeJS .... With a highly secure database system such as: Oracle, SQL Server, MySQL, PostgreSQL, MongoDB ... to help manage and manage your business up to date step by step and manage your business anytime, anywhere.</p><p style=\"text-align: justify; \"><b>Why develop according to customer needs?</b></p><p style=\"text-align: justify; \">Customer needs development is able to respond to the problems that customers are currently experiencing and to be in line with customer management and management policies, starting with interviews, collecting customer feedback, and implementing these ideas into a timely and systematic management system.</p><p style=\"text-align: justify; \"><b>The advantages of eye development are in demand</b></p><p style=\"text-align: justify; \">- Respond to all tasks that customers want to be modernized.</p><p style=\"text-align: justify; \">- Able to improve and develop the balance according to the needs of customers to make business expansion smoother.</p><p style=\"text-align: justify; \">- The budget is not high investment, one can invest the balance periodically.</p><p style=\"text-align: justify; \"><b>Disadvantages of existing programming system</b></p><p style=\"text-align: justify; \">- Can not meet all the work requirements of each business unit.</p><p style=\"text-align: justify; \">- Can not be updated or developed from the old system to the new system.</p><p style=\"text-align: justify; \">- Can not update the system, hunting makes it difficult and need to change the information constantly.</p><p style=\"text-align: justify; \"> </p>', 1, 1, '2021-07-24 15:58:00', '2021-08-27 17:34:42');
INSERT INTO `services` (`id`, `image`, `name_la`, `name_en`, `des_la`, `des_en`, `status`, `del`, `created_at`, `updated_at`) VALUES
(4, 'upload/service/1627296221BannerFacebook2.png', 'ໂຮງຮຽນ ແລະ ຫ້ອງຮຽນອອນລາຍ', 'CIT eLearning Online Platform', '<p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" style=\"width: 25%;\" data-filename=\"elearningbannar.jpg\"><br></p><p style=\"text-align: justify; \">ລະບົບໂຮງຮຽນ ແລະ ຫ້ອງຮຽນອອນລາຍ ເປັນລະບົບ ທີ່ຕອບໂຈດ ໃນຍຸກປະຈຸບັນ ເປັນຕົ້ນແມ່ນ ບັນຫາ ສະພາບ ໂຄວິດ ກຳລັງລະບາດໜັກໃນທົ່ວໂລກເວົ້າລວມ, ເວົ້າສະເພາະ ກໍ່ຄື ສປປ ລາວ ເຮົາ. ສະເນັ້ນ ລະບົບດັ່ງກ່າວ ຈິ່ງເຂົ້າມາມີບົດບາດຫຼາຍ ໃນຍຸກປະຈຸບັນ ເພື່ອອຳນວຍຄວາມສະດວກ ໃນການຕິດຕາມ ການຮຽນການສອນ, ການຊອກຮູ້ຮ່ຳຮຽນດ້ວຍຕົນເອງ, ການຫັນຈາກການສິດສອນແບບເກົ່າ, ການຕິດຕາມນັກຮຽນແບບເກົ່າ, ການຕິດຕາມຄະແນນແບບເກົ່າ ມາເປັນແບບໃໝ່ ທີ່ທັນສະໄໝຂື້ນ ໂດຍນຳໃຊ້ລະບົບ Platform ທີ່ທັນສະໄໝຂື້ນ, ຮັບຮູ້ຂໍ້ມູນໄດ້ທັນກັບເວລາ, ເຫັນໄດ້ທັງພາບ ແລະ ສຽງ.</p><p style=\"text-align: justify; \">ລະບົບໂຮງຮຽນ ຫຼື ຫ້ອງຮຽນອອນລາຍ ນອກຈາກຈະອຳນວຍຄວາມສະດວກ ໃຫ້ກັບໂຮງຮຽນແລ້ວ ຍັງເປັນອີກໜຶ່ງລະບົບ ທີ່ສາມາດສ້າງວຽກເຮັດງານທຳ ໃຫ້ທຸກໆສາຍອາຊີບ, ບຸກຄົນທົ່ວໄປ ທີ່ມີຄວາມຮູ້, ມີຄວາມສາມາດ ດ້ານຕ່າງໆ ເຂົ້າມາຫາລາຍໄດ້ ໂດຍສາມາດໃຊ້ເວລາຫວ່າງຂອງຕົນເອງ ສ້າງເປັນຫຼັກສູດການສອນ ເພື່ອຂາຍໃນລະບົບໄດ້.</p><p style=\"text-align: justify; \">ລະບົບ CIT eLearning ຂອງ ບໍລິສັດ ຊີໄອທີ ທີ່ກຳລັງໃຫ້ບໍລິການ ລາຍລະອຽດໃນເວັບໄຊ: https://citelearing.online&nbsp;</p><p style=\"text-align: justify; \"><br></p>', '<p> </p><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" style=\"width: 25%;\" data-filename=\"elearningbannar.jpg\"><br></p><p style=\"text-align: justify; \">The school system and online classrooms (e-Learning) are a system that responds to the challenges of the present era, such as the problem of the situation of the epidemic in the world, in general, in particular, the Lao PDR. Highlighting the system has come to play a role in the modern era to facilitate the monitoring of teaching and learning, self-learning, the transition from traditional teaching, tracking old students, tracking old scores to modern, using a modern and up-to-date platform.</p><p style=\"text-align: justify; \">The school system or online classroom, in addition to facilitating the school, is also a system that can create jobs for all professions, knowledgeable guests, with various abilities to earn money by being able to use their free time to create a course to sell in the system.</p><p style=\"text-align: justify; \">CIT eLearning of CIT SOLE CO.,LTD now servicing on website:&nbsp;<span style=\"font-size: 1rem;\">https://citelearing.online</span></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><br></span></p><p style=\"text-align: justify; \"> </p>', 1, 1, '2021-07-24 16:00:15', '2021-09-06 22:38:44');
