(4, 'ລະບົບ ໂຮງຮຽນ ແລະ ຫ້ອງຮຽນ ອອນລາຍ ທັນສະໄໝ', 'School management and e-learning platform', 'upload/slide/1630044659elearning.png', 1, 1, '2021-08-27 13:10:59', '2021-08-27 13:10:59');
INSERT INTO `solutions` (`id`, `image`, `solution_type_id`, `name_la`, `name_en`, `short_des_la`, `short_des_en`, `des_la`, `des_en`, `status`, `created_at`, `updated_at`) VALUES
(2, 'upload/solutions/163049754000.png', 2, 'eCIT Pro ລະບົບໂປຼແກຼມ POS ຂາຍໜ້າຮ້ານ ຫຼາຍສາຂາ Online', 'eCIT Pro Multi Branch POS and Sale management systems Online', '<p> <span style=\"font-size: 8px;\">﻿</span>ການຂາຍ, ລາຍຮັບ, ບິນຈ່າຍແລ້ວ, ບິນຕິດໜີ້, ຕິດຕາມສ້ອມແປງ, ສິນຄ້າ, ສາງສິນຄ້າ, ຂໍ້ມູນລູກຄ້າ, ໜີ້ຕ້ອງຮັບ, ລາຍການເຄື່ອນໄຫວ, ລາຍການສັ່ງຊື້, ໜີ້ຕ້ອງສົ່ງ, ລາຍຮັບ, ລາຍຈ່າຍອື່ນໆ ແລະ ລະບົບລາຍງານອີກ 75 ລາຍງານ. </p>', 'Sales, Revenue, Payments, Billing, Tracking Repairs, Goods, Inventory, Customer Information, Receipts, Operating Lists, Purchase Lists, Receipts, Expenditures, Other and 75 more reporting systems.', '<h2 style=\"color: rgb(61, 70, 77); font-family: Dhyana, sans-serif; text-align: center; font-weight: 700 !important;\"><span style=\"font-size: 14px;\"><span style=\"font-size: 18px;\">ໂມດູນຕ່າງ ຂອງ ລະບົບ</span> </span></h2><h2 style=\"text-align: justify;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><span style=\"font-size: 14px;\"><b>1. ໂມດູນ ຕັ້ງຄ່າລະບົບ ປະກອບມີ :</b> ເມນູຂໍ້ມູນຮ້ານຄ້າ, ເມນູຄຸ້ມຄອງສາຂາ, ເມນູຄຸ້ມຄອງພະນັກງານ,ເມນູ ອັດຕາການແລກປ່ຽນ, ເມນູເລກບັນຊີທີ່ໃຊ້ຊຳລະເງີນ, ເມນູສະຖານະສົ່ງສີນຄ້າ, ເມນູສະຖານະການຮັບປະກັນ, ເມນູແບ່ງສິດການນຳໃຊ້ໃຫ້ຜູ້ໃຊ້ລະບົບ, ເມນູເກັບຮັກສາ ຫລື backup ຂໍ້ມູນ.</span></font></h2><h2 style=\"text-align: justify;\"><b style=\"font-size: 14px; color: rgb(61, 70, 77); font-family: Dhyana, sans-serif; text-align: left;\">2. ໂມດູນ ຂາຍເຄື່ອງ ປະກອບມີ :</b><span style=\"font-size: 14px; color: rgb(61, 70, 77); font-family: Dhyana, sans-serif; text-align: left;\"> ເມນູລາຍການໃບບີນ, ລາຍການສົ່ງສີນຄ້າຄືນ.</span></h2><h2 style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><span style=\"font-size: 14px;\">- ເມນູ ລາຍການໃບບີນ : ໃນເມນູ ລາຍການໃບບີນນີ້ ລວມມີບັນດາເມນູຊ່ວຍໃຫ້ທ່ານເຮັດວຽກເຊັ່ນ: ຄົ້ນຫາໃບບີນ, ເພີ່ມໃບບີນ, ແກ້ໄຂໃບບີນ, ລົບໃບບີນ, ສົ່ງອອກ Excel(ສົ່ງລາຍການໃບບີນເປັນ file Excel), ຖັງຂີ້ເຫຍື້ອ(ໃນເມນູຖັງຂີ້ເຫຍື້ອນີ້ຈະເກັບເອົາຂໍ້ມູນໃບບີນການຂາຍຕ່າງໆທີ່ທ່ານໄດ້ລົບ).</span></font></h2><h2 style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><span style=\"font-size: 14px;\">- ເມນູ ລາຍການສົ່ງສີນຄ້າຄືນ : ຈະມີ ການຄົ້ນຫາໃບບີນສົ່ງສີນຄ້າຄືນ, ລົບລາຍການສົ່ງສີນຄ້າຄືນ, ສົ່ງອອກ Excel ( ສົ່ງລາຍການໃບບີນເປັນ file Excel ).</span></font><span style=\"color: rgb(61, 70, 77); font-family: Dhyana, sans-serif; font-weight: 700 !important; font-size: 14px;\">﻿</span><span style=\"color: rgb(61, 70, 77); font-family: Dhyana, sans-serif; font-weight: 700 !important; font-size: 8px;\">﻿</span><br></h2><h2 style=\"color: rgb(61, 70, 77); font-family: Dhyana, sans-serif; text-align: center; font-weight: 700 !important;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=01-2.png&amp;v=1630705535\" style=\"color: rgb(108, 117, 125); font-size: 1rem; font-weight: 400; width: 100%;\"></h2><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><br></font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>3. ໂມດູນ ຮັບປະກັນ ປະກອບມີ :</b> ເມນູ ລາຍການຮັບປະກັນເຊິ່ງໃນນີ້ລວມມີ ຄົ້ນຫາລາຍການຮັບປະກັນ, ເພີ່ມລາຍການຮັບປະກັນ, ລົບລາຍການຮັບປະກັນ, ຖັງຂີ້ເຫຍື້ອ(ໃນເມນູຖັງຂີ້ເຫຍື້ອນີ້ຈະເກັບເອົາຂໍ້ມູນໃບບີນການຂາຍຕ່າງໆທີ່ທ່ານໄດ້ລົບ).</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>4. ໂມດູນ ສີນຄ້າ ປະກອບມີ : </b>ເມນູສິນຄ້າ, ເມນູຍ້າຍສາງ, ເມນູກວດກາສີນຄ້າ, ເມນູພິ່ນລະຫັດບາໂຄດ :</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູສີນຄ້າ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ : ເມນູຄົ້ນຫາສີນຄ້າ, ເມນູເພີ່ມສີນຄ້າ, ເມນູແກ້ໄຂສີນຄ້າ, ເມນູລົບສີນຄ້າ, ເມນູເພີ່ມ Excel,ເມນູສົ່ງອອກ Excel, ເມນູຖັງຂີ້ເຫຍື້ອ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູຍ້າຍສາງ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ : ເມນູຄົ້ນຫາໃບເຄື່ອນຍ້າຍສີນຄ້າ, ເມນູເພີ່ມໃບເຄື່ອນຍ້າຍສີນຄ້າ, ເມນູລົບໃບເຄື່ອນຍ້າຍສີນຄ້າ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູກວດກາສີນຄ້າ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ :​ ເມນູຄົ້ນຫາໃບກວດເຄື່ອງ, ເມນູເພີ່ມໃບກວດເຄື່ອງ, ເມນູເພີ່ມ Excel.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູພີ່ນລະຫັດບາໂຄດ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>5. ໂມດູນ ສາງສີນຄ້າ ປະກອບມິ :</b> ເມນູເພີ່ມເຂົ້າສາງ,​ເມນູລາຍການສັ່ງຊື້, ເມນູສົ່ງສີນຄ້າຄືນ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູເພີ່ມເຂົ້າສາງ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ : ຄົ້ນຫາໃບບີນເຂົ້າສາງ, ເມນູເພີ່ມເຂົ້າສາງ, ເມນູແກ້ໄຂ,​ເມນູລົບ,​ ເມນູເພີ່ມ Excel, ເມນູສົ່ງອອກ Excel, ຖັງຂີ້ເຫຍື້ອ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ​ເມນູລາຍການສັ່ງຊື້ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ​ : ຄົ້ນຫາໃບບີນສັ່ງຊື້, ເມນູເພີ່ມໃບບີນສັ່ງຊື້, ເມນູແກ້ໄຂໃບບີນສັ່ງຊື້,​ ເມນູລົບໃບບີນສັ່ງຊື້,​ ເມນູເພີ່ມ Excel, ເມນູສົ່ງອອກ Excel, ຖັງຂີ້ເຫຍື້ອ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູລາຍການສົ່ງສີນຄ້າຄືນ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ : ຄົ້ນຫາໃບບີນສົ່ງເຄື່ອງ, ເມນູລົບ,​ ສົ່ງອອກ Excel.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>6. ໂມດູນ ລູກຄ້າ ປະກອບມີ :</b> ເມນູລູກຄ້າ, ເມນູ Promotion, ພີ່ນລະຫັດບາໂຄດ</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູລູກຄ້າ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ : ເມນູຄົ້ນຫາລູກຄ້າ, ເມນູເພີ່ມລູກຄ້າ, ເມນູແກ້ໄຂລູກຄ້າ, ເມນູເພີ່ມໃບບີນລູກຄ້າ, ເມນູລົບລູກຄ້າ,​ ເມນູເພີ່ມ Excel, ເມນູສົ່ງອອກ Excel, ຖັງຂີ້ເຫຍື້ອ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູ Promotion ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ :​&nbsp; ເມນູຄົ້ນຫາ, ເມນູລົບ, ເມນູເພີ່ມ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>7. ໂມດູນ ຜູ້ຈຳໜ່າຍ ປະກອບມີ :</b> ເມນູຜູ້ຈຳໜ່າຍ, ເມນູພີ່ນລະຫັດບາໂຄດ</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູຜູ້ຈຳໜ່າຍ ລວມມີເມນູຍ່ອຍປະກອບເຊັ່ນ : ຄົ້ນຫາຜູ້ຈຳໜ່າຍ, ເມນູເພີ່ມຜູ້ຈຳໜ່າຍ, ເມນູແກ້ໄຂຜູ້ຈຳໜ່າຍ,​ ເມນູລົບຜູ້ຈຳໜ່າຍ,​ ເມນູເພີ່ມ Excel, ເມນູສົ່ງອອກ Excel, ຖັງຂີ້ເຫຍື້ອ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູພິ່ນລະຫັດບາໂຄດ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>8. ໂມດູນ ລາຍຮັບ ແລະ ລາຍຈ່າຍ ປະກອບມີ :</b>&nbsp; ເມນູຄົ້ນຫາລາຍຮັບ ແລະ ລາຍຈ່າຍ, ເມນູເພີ່ມລາຍຮັບ ແລະ ລາຍຈ່າຍ, ເມນູແກ້ໄຂລາຍຮັບ ແລະ ລາຍຈ່າຍ,​ ເມນູລົບລາຍຮັບ ແລະ ລາຍຈ່າຍ, ເມນູພີ່ນ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><b>9. ໂມດູນ ລາຍງານ ປະກອບມິ :</b> ເມນູລວມທັງໝົດ, ເມນູຂາຍເຄື່ອງ, ເມນູຍອດເຫລືອ, ເມນູໜີ້ສິນ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູລວມທັງໝົດ :​ ເມນູນີ້ຈະສະແດງແລະສະຫຼຸບ ລາຍຮັບ, ລາຍຈ່າຍ, ຜົນທີ່ໄດ້ຮັບ, ລວມຍອດຂາຍ, ສາງທັງໝົດ, ລາຍຮັບອື່ນໆ, ລາຍຈ່າຍອື່ນໆ ແລະກຳໄລ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູຂາຍເຄື່ອງ : ເມນູນີ້ຈະສະແດງແລະສະຫຼຸບຄີນຄ້າເຊັ່ນ: ສະຫຼຸບຕາມສີນຄ້າ, ສະຫຼຸບຕາມລາຄາຂາຍຂອງສີນຄ້າ, ສະຫຼຸບຕາມກຸ່ມສີນຄ້າ, ສະຫຼຸບຕາມກຸ່ມລູກຄ້າ, ສັງລວມຕາມພະນັກງານ, ລາຍງານ ລາຍຮັບ - ລາຍຈ່າຍ ຂາຍເຄື່ອງ, ລາຍລະອຽດຂາຍເຄື່ອງ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູສາງສີນຄ້າ : ເມນູນີ້ຈະສະແດງແລະສະຫຼຸບລວມສີນຄ້າໃນສາງ, ສະຫຼຸບລາຍລະອຽດສີນຄ້າໃນສາງ, ສະຫຼຸບສີນຄ້າທີ່ເພີ່ມເຂົ້າສາງຕາມຜູ້ຈຳໜ່າຍ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູຍອດເຫລືອ : ເມນູນີ້ຈະສະແດງແລະສະຫຼຸບເຄື່ອງຍັງເຫລືອໃນສາງ - ຕາມສີນຄ້າແລະສະຫຼຸບເຄື່ອງຍັງເຫຼືອໃນສາງ - ຕາມລາຍການສີນຄ້າ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\">- ເມນູໜີ້ສີນ : ເມນູນີ້ຈະສະແດງແລະສະຫຼຸບໜີ້ສີນຕ້ອງຮັບຕາມກູ່ມລູກຄ້າ, ສະຫຼຸບໜີ້ສີນຕ້ອງຮັບຕາມລູກຄ້າ, ລາຍລະອຽດໜີ້ສີນຕ້ອງຮັບ, ສະຫຼຸບໜີ້ສີນຕ້ອງຈ່າຍຕາມກູ່ມຜູ້ຈຳໜ່າຍ, ສະຫຼຸບຕາມຜູ້ຈຳໜ່າຍ, ລາຍລະອຽດໜີ້ສີນຕ້ອງສົ່ງ.</font></p><p style=\"text-align: left;\"><font color=\"#3d464d\" face=\"Dhyana, sans-serif\"><br></font></p><div style=\"text-align: center; color: rgb(108, 117, 125); font-family: Dhyana, sans-serif;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=2021-01.png&amp;v=1630707434\" style=\"width: 100%;\"><span style=\"font-family: &quot;Phetsarath OT&quot;;\"><br></span></div><div style=\"text-align: justify; color: rgb(108, 117, 125); font-family: Dhyana, sans-serif;\"><span style=\"font-family: &quot;Phetsarath OT&quot;;\"><br></span></div><div style=\"text-align: justify; color: rgb(108, 117, 125); font-family: Dhyana, sans-serif;\"><div style=\"color: rgb(33, 37, 41); font-family: &quot;Phetsarath OT&quot;;\">ທົດລອງໃຊ້ງານ:&nbsp;<a href=\"http://demo.citgroup.la/\" target=\"_blank\">http://demo.citgroup.la</a>&nbsp;</div><div style=\"color: rgb(33, 37, 41); font-family: &quot;Phetsarath OT&quot;;\">User: admin</div><div style=\"color: rgb(33, 37, 41); font-family: &quot;Phetsarath OT&quot;;\">Pass: 123456</div></div><div style=\"text-align: justify; color: rgb(108, 117, 125); font-family: Dhyana, sans-serif;\"><span style=\"font-family: &quot;Phetsarath OT&quot;;\"><br></span></div>', '<div style=\"text-align: center; \"><div style=\"text-align: center;\"><b><span style=\"font-size: 18px;\">Modules in the POS application</span></b></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: justify;\"><b>1. The system configuration module includes:</b> Store information menu, branch management menu, staff management menu, exchange rate menu, payment account menu, shipping status menu, warranty status menu, authorization menu, storage or backup menu.</div><div style=\"text-align: justify;\"><b>2. Sales module includes: menu, invoice list, return list.</b></div><div style=\"text-align: justify;\">- Billing menu: This billing menu includes menus that allow you to perform tasks such as searching bills, adding bills, editing bills, deleting bills, exporting Excel (export bills as an Excel file), Trash (in this Trash menu will store the sales invoices you have deleted).</div><div style=\"text-align: justify;\">- Return item menu: There will be a search for a return invoice, delete the return item, export Excel (send the invoice as an Excel file).</div></div><div style=\"text-align: center; \"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=01-2.png&amp;v=1630705535\" style=\"font-size: 1rem; width: 100%;\"><br></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><div><b>3. Warranty module includes:</b> Warranty menu, which includes searching for warranty items, adding warranty items, deleting warranty items, Trash (in this Trash menu will collect sales invoice information that you have deleted).</div><div><b>4. Commodity module includes:</b> Inventory menu, Inventory move menu, Inventory inspection menu, Barcode menu:</div><div>Product menu includes submenus such as product search menu, product add-on menu, product edit menu, product deletion menu, Excel add-on menu, Excel export menu, Trash menu.</div><div>- Warehouse move menu includes sub-menus such as menu to search for invoices, menus to add invoices, menus to delete invoices.</div><div>- Check menu includes sub-menus such as check menu, check menu, add Excel menu.</div><div>- Barcode menu.</div><div><b>5. Inventory module includes:</b> Add menu, Inventory menu, Return menu.</div><div>- Add-in menu includes submenus such as search inventory, add-in menu, edit menu, delete menu, add-in Excel menu, export Excel menu, Trash.</div><div>The order menu includes sub-menus such as Search Order, Add Accounts menu, Edit Order menu, Delete Order menu, Add Excel menu, Excel Export menu, Trash.</div><div>The return item menu includes submenus such as search invoice, delete menu, export Excel.</div><div><b>6. Custom modules include:</b> Custom Menu, Promotion Menu, Barcode Scanner</div><div>- Custom menu includes submenus such as Custom Search menu, Add client menu, Custom edit menu, Add customer invoice menu, Delete client menu, Add Excel menu, Excel export menu, Trash.</div><div>- Promotion menu includes submenus such as search menu, delete menu, add menu.</div><div><b>7. Reseller module includes:</b> Reseller menu, barcode code menu</div><div>The Reseller menu includes submenus such as Search Reseller, Add Result menu, Edit Result menu, Delete Result menu, Add Excel menu, Excel Export menu, Trash.</div><div>- Barcode menu.</div><div><b>8. Income and Expenditure Modules include:</b> Income and Expenditure Search Menu, Income and Expenditure Increase Menu, Income and Expenditure Editing Menu, Income and Expenditure Deletion Menu, Ping Menu.</div><div><b>9. Reporting module includes:</b> menu including fridge, sales menu, balance menu, credit menu.</div><div>Menu Including Budget: This menu displays and summarizes revenue, expenditure, results, total sales, inventory, other revenue, other expenses, and profits.</div><div>- Sales menu: This menu will display and summarize products, such as product summary, product price summary, product group summary, customer group summary, employee summary, sales revenue report, sales details.</div><div>- Inventory menu: This menu will display and summarize the goods in the inventory, summarize the details of the goods in the inventory, summarize the goods added to the inventory according to the seller.</div><div>- Balance menu: This menu displays and summarizes inventory-by-inventory and summarizes inventory-by-inventory.</div><div>- Menu: This menu will display and summarize the debt to be received by the customer group, summary of the debt to be received by the customer, details of the debt to be received, summary of the debt to be paid by the group of customers, summary of the seller, details of the debt to be sent.</div></div><div style=\"text-align: justify; \"><br></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=2021-01.png&amp;v=1630707434\" style=\"width: 100%;\"><br></div><div style=\"text-align: justify; \"><br></div><div style=\"text-align: justify; \">Demo:&nbsp;<a href=\"http://demo.citgroup.la\" target=\"_blank\">http://demo.citgroup.la</a>&nbsp;</div><div style=\"text-align: justify; \">User: admin</div><div style=\"text-align: justify; \">Pass: 123456</div><div style=\"text-align: justify; \"><br></div>', 1, '2021-09-01 11:59:00', '2021-09-05 07:51:00'),
(3, 'upload/solutions/163057569902 Parking.png', 2, 'CIT Parking ລະບົບໂປຼແກຼມຄູ້ມຄອງ ແລະ ຕິດຕາມ ຝາກລົດ Online', 'CIT Parking Management systems Online', '<div style=\"text-align: justify;\"><br></div>', NULL, '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">CIT Parking ລະບົບໂປຼແກຼມຄູ້ມຄອງ ແລະ ຕິດຕາມ ຝາກລົດອອນລາຍ ເປັນລະບົບໜຶ່ງ ທີ່ພັດທະນາຂື້ນມາ ໂດຍ ບໍລິສັດ ຊີໄອທີ ຈຳກັດຜູ້ດຽວ ໃຊ້ເພື່ອຕອບໂຈດບັນຫາ ເລື່ອງການຝາກລົດແບບເກົ່າ ມາຫັນຕິດຕາມ ແລະ ຝາກລົດແບບໃໝ່ ໂດຍສາມາດ ຄູ້ມຄອງ ແລະ ຕິດຕາມຜ່ານອອນລາຍໄດ້ ນຳຄອມພິວເຕີ, ໂທລະສັບມືຖື ໄດ້ທຸກທີ່ ທຸກເວລາ ແລະ ບໍ່ຈຳກັດອຸປະກອນເຂົ້າໃຊ້ງານ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=02%20Parking-1.png&amp;v=1630708037\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 24px;\"><b>ໂໝດ ໂທລະສັບມືຖື</b></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=02-Parking-2.png&amp;v=1630708903\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">ເຂົ້າທົດລອງນຳໃຊ້ໄດ້ທີ:&nbsp;</span><a href=\"http://parkingdemo.citgroup.la\" target=\"_blank\">http://parkingdemo.citgroup.la</a><a href=\"http://parkingdemo.citgroup.la\" target=\"_blank\"></a></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">ຊື່ຜູ້ໃຊ້: admin@admin.com</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">ລະຫັດຜ່ານ: 123456</span></div>', '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">CIT Parking is an online car management and tracking system online developed by CIT SOLE Co., Ltd. to solicit the problem of old-fashioned car parking to track and store new cars by being able to manage and track online from any computer, mobile phone or mobile device.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=02%20Parking-1.png&amp;v=1630708037\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 24px;\"><b>SmartPhone View</b></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=02-Parking-2.png&amp;v=1630708903\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Demo:&nbsp;</span><a href=\"http://parkingdemo.citgroup.la\" target=\"_blank\">http://parkingdemo.citgroup.la</a><a href=\"http://parkingdemo.citgroup.la/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\"></a></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">Username: admin@admin.com</span></div><div style=\"text-align: justify;\"><span style=\"text-align: left;\">Password: 123456</span><span style=\"font-size: 1rem;\"><br></span></div>', 1, '2021-09-02 16:41:39', '2021-09-04 05:57:55'),
(4, 'upload/solutions/163071717503 CIT FM.png', 2, 'CIT FMS ລະບົບໂປຼແກຼມເກັບລາຍຮັບປະຈຳ', 'CIT Fee Management Systems', NULL, NULL, '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">CIT FMS ເປັນລະບົບໂປຼແກຼມ ເກັບລາຍຮັບປະຈຳ ໃຊ້ເພື່ອຕິດຕາມ ແລະ ເກັບລາຍຮັບປະຈຳ ເພື່ອຊ່ວຍໃຫ້ຫົວໜ່ວຍທຸລະກິດ ສາມາດຕິດຕາມການເກັບລາຍຮັບ ຂອງຕົນເອງໄດ້ແບບທັນສະໄໝ, ສາມາດໃຊ້ອອນລາຍ ຜ່ານໂທລະສັບມືຖື, ເທບເລັດ, ຄອມພິວເຕີ ແລະ ອຸປະກອນ Smart ອື່ນໆ ທີ່ເຊື່ອມໂຍງກັບອີນເຕີເນັດ. ລະບົບດັ່ງກ່າວ ເໝາະກ່ຽວກັບ ການເກັບລາຍຮັບຄ່າຂີ້ເຫຍື້ອ, ລາຍຮັບຮຽນເພີ່ມ, ເງິນຄ່າຮຽນ ແລະ ອື່ນໆ ທີ່ຫົວໜ່ວຍທຸລະກິດ ຕິດຕາມການເກັບລາຍຮັບ ປະຈຳວັນ, ເດືອນ, ງວດ ແລະ ປີ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=03%20CIT%20FM-1.png&amp;v=1630717126\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=03-CIT-FM-0.png&amp;v=1630744958\" style=\"width: 50%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">ທົດລອງໃຊ້ງານຟຼີ: </span><a href=\"http://fm.citgroup.la\" target=\"_blank\">http://fm.citgroup.la</a><span style=\"font-size: 1rem;\">&nbsp;</span></div>', '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">CIT FMS is a revenue collection system used to track and collect revenue to help businesses keep track of their revenue stream, accessed online via mobile phones, tablets, computers and other smart devices connected to the Internet. The system deals with the collection of garbage revenue, additional tuition revenue, tuition fees, etc. that the business unit monitors the collection of daily, monthly, quarterly and annual revenue collection.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=03%20CIT%20FM-1.png&amp;v=1630717126\" style=\"width: 100%;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=03-CIT-FM-0.png&amp;v=1630744958\" style=\"width: 50%;\"><br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify;\">Demo: <a href=\"http://fm.citgroup.la\" target=\"_blank\">http://fm.citgroup.la</a>&nbsp;</div>', 1, '2021-09-04 07:59:35', '2021-09-04 15:43:26'),
(5, 'upload/solutions/1630813160Overview-8801.png', 1, 'ໂຊລູຊັ່ນ ລະບົບການສຶກສາ ແບບທັນສະໄໝ ດ້ວຍ AI Dahua Technology', 'AI Dahua Technology education solutions', NULL, NULL, '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">ຄືສຸພາສິດ ໄດ້ກ່າວໄວ້ວ່າ \"ເພື່ອຜົນປະໂຫຍດ 10 ປີ ໃຫ້ປູກຕົ້ນໄມ້, ເພື່ອຜົນປະໂຫຍດ 100 ປີ ໃຫ້ປູກຄົນ\" ສະນັ້ນ, ການສຶກສາ ເປັນກຸນແຈສຳຄັນ ຕໍ່ກັບການພັດທະນາປະເທດຊາດຂອງພວກເຮົາ, ເປັນຂະແໜງການໜຶ່ງ ທີ່ພັກ ແລະ ລັດຖະບານໃຫ້ຄວາມສຳຄັນຫຼາຍ ແລະ ໄດ້ຖືບູລິມະສິດ ເປັນອັນດັບຕົ້ນໆ ໃນການພັດທະນາ ຊັບພະຍາກອນມະນຸດ.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Dahua Technology ໄດ້ຮ່ວມເປັນສ່ວນໜຶ່ງ ເຂົ້າຊ່ວຍໃນການປັບປຸງການສຶກສາ ໃຫ້ຫັນເປັນທັນເປັນທັນສະໄໝເທື່ອລະກ້າວ ໂດຍການນຳໃຊ້ເຕັກໂນໂລຊີ AI ເຂົ້າຊ່ວຍໃນການຕິດຕາມການສຶກສາ ແຫ່ງຍຸກ IoT (Internet Of Things) ເພື່ອສ້າງສະພາບແວດລ້ອມ ອຳນວຍຄວາມສະດວກ ແລະ ຮັກສາຄວາມຄວາມປອດໄພ ໃນຂອບເຂດຂອງໂຮງຮຽນ ແບບທັນສະໄໝ ນຳໃຊ້ລະບົບກ້ອງອັດສະລາຍະ ຊ່ວຍເຂົ້າໃນການຮຽນການສອນ ໃຫ້ມີປະສິດທິຜົນສູງ, ນຳໃຊ້ເປັນ Big Data ໄດ້, ມີຂໍ້ມູນຮັດກູມ ຈຳແນນໄດ້ບຸກຄົນອັນຕະລາຍ ເຮັດໃຫ້ໂຮງຮຽນ ເປັນໂຮງຮຽນທີ່ມີຄວາມປອດໄພສູງ ແລະ ມີຄວາມທັນສະໄໝເທື່ອລະກ້າວ.</span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=Overview-8802.png&amp;v=1630813288\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=Overview-88002-1.png&amp;v=1630813288\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\"><br></span></div>', '<div style=\"text-align: justify; \"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\">As the saying goes, “It takes ten years to grow a tree, but a hundred to cultivate a person.” Education serves as the golden key to our dreams and the driving force of human development.</span></font></div><div style=\"text-align: justify; \"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\">Dahua actively participates in the modernization of education with the help of video-centric AI, biometric recognition and IoT technology, creating a safe and enjoyable educational environment for students. Through intelligent security, smart teaching and campus Big Data application, it fully integrates teaching, campus management and campus life in order to build a smart campus.</span></font></div><div style=\"text-align: justify; \"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=Overview-8802.png&amp;v=1630813288\" style=\"width: 100%;\"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></div><div style=\"text-align: justify; \"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=Overview-88002-1.png&amp;v=1630813288\" style=\"width: 100%;\"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></div><div style=\"text-align: justify; \"><font color=\"#333333\" face=\"segoe ui, PingFang SC, Arial, Microsoft Yahei, Helvetica Neue, Helvetica, Tahoma, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></div>', 1, '2021-09-05 10:39:20', '2021-09-05 10:43:32'),
(6, 'upload/solutions/1630814334Warehouse logistics-2.png', 1, 'ໂຊລູຊັ່ນ ສຳລັບສາງ ແລະ ຂົນສົ່ງດ່ວນ ທັນສະໄໝ', 'Dahua Technology warehouse and logistics solutions', NULL, NULL, '<div style=\"text-align: justify; \">ໂຊລູຊັ່ນ ສຳລັບສາງ ແລະ ຂົນສົ່ງດ່ວຍ ທັນສະໄໝ Dahua Technology ເປັນຜູ້ບຸກເບີກການຂົນສົ່ງທີ່ສະຫຼາດ ແລະ ກໍາລັງພະຍາຍາມຫັນນຳໃຊ້ເຕັກໂນໂລຊີທີ່ທັນສະໄໝ ເຂົ້າໃນການຊ່ວຍເຫຼືອ ແລະ ເຫັນຄວາມສໍາຄັນໃຫ້ກັບອຸດສາຫະກໍາການຂົນສົ່ງທີ່ທັນສະໄໝ,&nbsp;<span style=\"font-size: 1rem;\">ການແກ້ໄຂບັນຫາການຂົນສົ່ງດ່ວນ ໂດຍສຸມໃສ່ 3 ສະຖານະການ ແລະ 4 ວັດຖຸປະສົງ ໃນການແກ້ໄຂຄວາມຫຍຸ້ງຍາກກ່ຽວກັບວຽກວຽກການຄູ້ມຄອງສາງ ແລະ ຂົນສົ່ງດ່ວນ ໂດຍຜູ້ລົງທຶນ ສາມາດປະຫຍັດໄດ້ ແຮງງານໜ້ອຍ, ປະສິດທິພາບສູງກວ່າ, ມີຄຸນນະພາບສູງກວ່າ, ມີຄວາມປອດໄພຫຼາຍຂຶ້ນ.</span></div><div style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=Warehouse%20logistics.png&amp;v=1630814386\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><br></span></div>', '<div style=\"text-align: justify; \">Dahua Technology, as a pioneer of smart logistics, is striving to inject new technology and vitality to the modern logistics industry.&nbsp;<span style=\"font-size: 1rem;\">Smart express logistics solution focus on 3 scenarios and 4 objects in the express work flow, it brings four values to logistics customers, less labor, higher efficiency, higher quality, more security.</span></div><div style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"https://citgroup.la/file-manager/preview?disk=images&amp;path=Warehouse%20logistics.png&amp;v=1630814386\" style=\"width: 100%;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: justify; \"><span style=\"font-size: 1rem;\"><br></span></div>', 1, '2021-09-05 10:58:54', '2021-09-05 11:04:24'),
